import pulumi_f5bigip as f5bigip

param1 = f5bigip.ssl.get_waf_entity_parameter(name="Param1",
    type="explicit",
    data_type="alpha-numeric",
    perform_staging=True)
param2 = f5bigip.ssl.get_waf_entity_parameter(name="Param2",
    type="explicit",
    data_type="alpha-numeric",
    perform_staging=True)
